import * as actions from './actionTypes';

export const updateStories = stories => ({
    type: actions.STORIES_UPDATE,
    payload: stories
});

export const uploadComments = commentsData => ({
    type: actions.COMMENTS_UPLOAD,
    payload: commentsData
});
